import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="mb-2 shadow-md min-h-4 p-4">
      <Router>
        <nav>
          <ul className="flex justify-center">
            <li className="px-4 py-2 mx-2">
                <Link path="/" exact>Home</Link>
            </li>
            <li className="px-4 py-2 mx-2">
                <Link path="/about" exact>About</Link>
            </li>
          </ul>
        </nav>
      </Router>
    </div>
  );
};

export default Header;
